import React from 'react';
import { NavLink } from 'react-router-dom';

export const Signup = () => {
  return (
    <>
    <NavLink to={`/registracija`} className="btn btn-outline-dark ms-2" data-bs-toggle="modal" data-bs-target="#loginModal"><i className="fa fa-sign-in me-2"></i> Registracija</NavLink>
    </>
  )
}
